import React from "react";

class List extends React.Component { 

  async load() {
    const listFull = [];
    const itemSpace = await this.fetchSpace();
    const itemUser = await this.fetchUser();
    for(let item of itemSpace){
      if(item.status === 1){
        this.statusOne(item.id, itemUser)
      } else if (item.status === 0){
        console.log(this.statusZero(item.id))
      } else {console.log("Ошибка")}
    }
  }

  statusOne = (id, users) => {
    return ``
  }
  statusZero = (id) => {
    return `${id} - Свободно`
  }

  async fetchUser() {
    const response = await fetch('/api/users');
    const {users} = await response.json();
    return users;
  }

  async fetchSpace() {
    const response = await fetch('/api/spaces');
    const {data} = await response.json();
    return data;
  }
  // createList = spacesList.map((id) => // json спосик нужен
  //   <li>{id}</li>
  // );

  render() {
    return(
      <ul>
        {this.load()}
      </ul>
    )
  }
}

export default List;
